@softwarechecker,

there is a major advantage of KMS over MAk activation.  microsoft can easily blacklist MAK serial, while finding it hard to do the same to KMS.

it is correct that KMS is only for 180 days.  but if you set windows scheduler to automatically run KMS every 180 days, it is the same as permanent activation.  it runs transparently.  you won't even notice it.
